  render() {
    return (
      <Container className='justify-content-center d-flex align-items-center'>
        <Row>
          <Col id='column-1'>
          <h1 className='fs-1 text-white m-3 text-capitalize fw-normal'>our mission</h1>
          <p className='m-3 text-white'>Non veritatis tempor elementum integer? Ridiculus aspernatur debitis habitant fusce, egestas fuga maecenas! Rerum vel mauris illo eveniet, viverra doloribus, minima velit magnam justo et.</p>
          </Col>
          <Col id='column-2'>
          <h1 className='fs-1 text-white m-3 text-capitalize fw-normal'>
          our vision
          </h1>
          <p className='m-3 text-white'>Omnis porta diamlorem quas donec placerat. Torquent modi donec nullam, odio elit error, quos tortor facere? Vero, nihil faucibus tincidunt. Placeat nisl earum molestias porta! Cursus fringilla, lacinia pariatur impedit metus imperdiet occaecat aliquip ullamcorper et earum neque fermentum, praesent.</p>
          </Col>
          <Col id='column-3'>
          <h1 className='fs-1 m-3 text-white text-capitalize fw-normal'>core values</h1>
          <p className='text-white m-3'>Omnis porta diamlorem quas donec placerat. Torquent modi donec nullam, odio elit error, quos tortor facere? Vero, nihil faucibus tincidunt. Placeat nisl earum molestias porta.</p>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default AutoLayoutExample;
